using System;
using System.Globalization;

public static class StringExtensions
{
    public static string ToTitleCase(this string input)
    {
        if (string.IsNullOrEmpty(input))
            return input;

        TextInfo textInfo = CultureInfo.CurrentCulture.TextInfo;
        return textInfo.ToTitleCase(input.ToLower());
    }
}

Dependency Injection (DI) is a design pattern used to achieve Inversion of Control between classes and their dependencies.
In ASP.NET Core, DI is built-in and helps manage the lifecycle of objects and their dependencies.

Here's a step-by-step explanation:

1. **Registering Services**: First, services are registered in the `Startup.cs` file using the `ConfigureServices` method. This can be done with various lifetimes (Singleton, Scoped, Transient).

   ```csharp
   public void ConfigureServices(IServiceCollection services)
   {
       services.AddSingleton<IMyService, MyService>();
       // or
       services.AddScoped<IService1, Service1>();
       services.AddTransient<Service2>();
   }
   ```

2. **Injecting Services**: Once registered, these services can be injected into classes using constructor injection.

   ```csharp
   public class HomeController : Controller
   {
       private readonly IMyService _myService;

       public HomeController(IMyService myService)
       {
           _myService = myService;
       }

       // Use the service in your actions or other methods.
   }
   ```

3. **Lifetime Management**: The lifetime of a service determines when it is created and destroyed.

   - **Singleton**: Created once per application lifecycle.
   - **Scoped**: Created once per client request (e.g., HTTP request).
   - **Transient**: New instance every time the dependency is requested.

4. **Factory Pattern**: For more complex scenarios, you can use factory methods to create instances of services.

   ```csharp
   public void ConfigureServices(IServiceCollection services)
   {
       services.AddTransient<IMyService>(provider => 
           new MyService(provider.GetService<IService1>(), provider.GetService<Service2>()));
   }
   ```

5. **Middleware and Filters**: DI is also used for middleware and filters, where dependencies are injected into the pipeline.

6. **Configuration**: Configuration values can be injected using `IOptions<T>` or directly through constructor injection if they implement an interface.

By leveraging Dependency Injection in ASP.NET Core, you ensure that your application remains modular, testable, and maintainable by decoupling components from each other.
