using System; public record Person(string FirstName, string LastName); class Program { static void Main() { var person1 = new Person("John", "Doe"); var person2 = new Person("Jane", "Doe");
// Equality is based on property values
bool isEqual = person1 == person2;
Console.WriteLine(isEqual ? "The people are equal." : "The people are not equal.");
person2 = person2 with { FirstName = "John" };
isEqual = person1 == person2; Console.WriteLine(isEqual ? "The people are still equal after changing the first name of the second person." : "The people are no longer equal after changing the first name of the second person."); } }
In this example, we create a Person record with two properties: FirstName and LastName. The equality operator (==) checks if both records have the same property values.
Records also provide handy syntax for copying and modifying instances using with statements:
var updatedPerson = person1 with { Age = 30 }; // Creates a new instance of Person, keeping all existing properties unchanged except for the specified ones
The main benefit of using records is that they promote more predictable and less error-prone code by providing immutability out-of-the-box.
